  loadSavedGame: function(){
	 // Powerup state
    RocketTux.powerUpActive = 'none';
    var tmpPwrup = localStorage.getItem('RocketTux-powerUpActive');
    if (tmpPwrup == null || tmpPwrup == undefined){
        // Initial first saved data
        localStorage.setItem('RocketTux-powerUpActive', 'none');
    } else {
        RocketTux.powerUpActive = tmpPwrup;
    }
    
    // Load Inventory
    RocketTux.inventory = {};
    var tmpInv = localStorage.getItem('RocketTux-invItem196');
    if (tmpInv == null || tmpInv == undefined){
        // Initial first saved data
        for (i = 0; i < 197; i++){
            localStorage.setItem('RocketTux-invItem' + i, 0);
        }
        // Set initialized condition (Only items 0-195 are used as actual inventory items)
        localStorage.setItem('RocketTux-invItem196', 999);
    } else {
       // Load data into array
       for (i = 0; i < 197; i++){
            RocketTux.inventory[i] = parseInt(localStorage.getItem('RocketTux-invItem' + i));
        }
    }
    
    // Cubimal Data
    var tmpcubCF = localStorage.getItem('RocketTux-cubItemBonus');
    if (tmpcubCF == null || tmpcubCF == undefined){
        // Initial first saved data
        localStorage.setItem('RocketTux-cubItemBonus', '2'); // 3-6 reduce Cubimal item cost
    }
    
    var tmpcubCF = localStorage.getItem('RocketTux-cubCoinBonus');
    if (tmpcubCF == null || tmpcubCF == undefined){
        // Initial first saved data
        localStorage.setItem('RocketTux-cubCoinBonus', '0'); // Percent change Cubimal coin cost
    }
    
     // Main Menu game controller color
    RocketTux.mainMenuColor = '0xB7B7B7';
    var tmpMainMenuColor = localStorage.getItem('RocketTux-mainMenuColor');
    if (tmpMainMenuColor == null || tmpMainMenuColor == undefined){
        // Initial first saved data
        localStorage.setItem('RocketTux-mainMenuColor', '0xB7B7B7');
    } else {
        RocketTux.mainMenuColor = tmpMainMenuColor;
    }
    
    // Game controller screen text color
    // When used for text it gets prefixed with #, but for graphics it needs a 0x prefix
    // Green 01BB01, Amber FFBF00, White FFFFFF, Red FF0000, Ice Blue 66FFFF, Deep Blue 3333FF, Purple DD33FF, Pink FF0080
    RocketTux.scrnTextColor = '01BB01';
    var tmpScrnTextColor = localStorage.getItem('RocketTux-scrnTextColor');
    if (tmpScrnTextColor == null || tmpScrnTextColor == undefined){
        // Initial first saved data
        localStorage.setItem('RocketTux-scrnTextColor', '01BB01');
    } else {
        RocketTux.scrnTextColor = tmpScrnTextColor;
    }
    
    // Level unlocks 
    // These are index values corresponding to the level names in mainmenu.js: this.scrNames[]
    RocketTux.levelUnlocks = '0,1,2';
    var tmpUnlocks = localStorage.getItem('RocketTux-levelUnlocks');
    if (tmpUnlocks == null || tmpUnlocks == undefined){
        // Initial first saved data
        localStorage.setItem('RocketTux-levelUnlocks', '0,1');
    } else {
        RocketTux.levelUnlocks = tmpUnlocks;
    }
    
    // Init or fix potentially bugged coins
    var savedCoins = parseInt(localStorage.getItem('RocketTux-myWallet'));
    if (isNaN(savedCoins)){
        localStorage.setItem('RocketTux-myWallet', '1');
    }
    
    // Karma, used when determining donation rewards
    var tmpKarma = localStorage.getItem('RocketTux-myKarma');
    if (tmpKarma == null || tmpKarma == undefined){
        // Initial first saved data
        localStorage.setItem('RocketTux-myKarma', '0');
    }
    
    // Luck, used when determining various bonuses and rewards
    // 66 Max: 42 from donations, 12 from powerups, and 12 from Cubimals (6+4+2)
    var tmpLuck = localStorage.getItem('RocketTux-myLuck');
    if (tmpLuck == null || tmpLuck == undefined){
        // Initial first saved data
        localStorage.setItem('RocketTux-myLuck', '0');
    }
    RocketTux.luck = parseInt(localStorage.getItem('RocketTux-myLuck'));
  },
